"use strict";
var Complex=require('Complex'); //exportable class
var Gamma=function( options){ //exposure, alpha, b, sigma, t, x0...dx=alpha(b-x)dt+sigma sqrt(x) dw
	this.a=options.a;
	this.b=options.b;
}
Gamma.prototype.execute=function(u){
	return new Complex(1, 0).subtract(u.multiply(new Complex(this.b, 0))).power(-this.a);
}
module.exports=Gamma; //exportable class

